import Nav from "./Nav";

const Layout = props => {
  const Link = (
    <link
      href="https://fonts.googleapis.com/css?family=Montserrat:400,500,600&display=swap"
      rel="stylesheet"
    />
  );
  return (
    <div>
      <Nav />
      <div className="layout">{props.children}</div>
      <style jsx global>
        {`
          *,
          *::before,
          *::after {
            box-sizing: border-box;
            margin: 0;
            padding: 0;
          }
        `}
      </style>
    </div>
  );
};

export default Layout;
